import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'DirectivesAssignment';
}
<main>
  <h1 id="welcome">Welcome to the Angular Directives Assignment!</h1>
  <a id="instructions" target="_blank"
    href="https://docs.google.com/document/d/1_YenRjw_8mcEsz-l1WIfihNK_YpJ-esBB7SIcBAi7fs/edit?usp=sharing">
    Get started with the instructions here
  </a>
  <app-about></app-about>
  <app-fav-video></app-fav-video>
  <app-playground></app-playground>
</main>
